import {Routes,Route,Router } from 'react-router-dom';
import "./App.css";
import LobbyScreen from "./screens/Lobby";

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" element={<LobbyScreen />} />
        </Router>
    </div>
  );
}

export default App;
